import React from "react";
import {
  Button,
  ButtonGroup,
  DropdownButton,
  MenuItem,
  Dropdown,
} from "react-bootstrap";

function NavPlaceholder() {
  return (
    <div className="navbar">
      <h3 className="title">MINERVA MENTORSHIP</h3>
      <Dropdown>
        <Dropdown.Toggle variant="success" id="dropdown-basic">
          BIOS
        </Dropdown.Toggle>
        <Dropdown.Menu>
          <Dropdown.Item href="#/action-1">SCIENCE</Dropdown.Item>
          <Dropdown.Item href="#/action-1">TECHNOLOGY</Dropdown.Item>
          <Dropdown.Item href="#/action-2">ENGINEERING</Dropdown.Item>
          <Dropdown.Item href="#/action-3">MATHEMATICS</Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>
      <button>MENTORS</button>
      <button>BECOME A MENTOR</button>
      <button>BECOME A MENTEE</button>
    </div>
  );
}

export default NavPlaceholder;
